B.E7=new A.ol("Known Limitations","Dat fiind modul de lucru momentan pentru web hotreload-ul pare sa nu functioneze;\n",null)
B.E8=new A.ol("The goal","\u2022 Crearea unui storybook pentru Flutter este o metod\u0103 eficient\u0103 de a uniformiza design-ul \u0219i de a oferi exemple clare pentru a ajuta dezvoltatorii s\u0103 \xeen\u021beleag\u0103 \u0219i s\u0103 utilizeze eficient acest framework. Un storybook este o colec\u021bie de componente UI, care pot fi vizualizate \u0219i testate separat sau \xeempreun\u0103, pentru a crea aplica\u021bii cu un aspect \u0219i o func\u021bionalitate uniform\u0103.\n\n\u2022 Crearea unui storybook pentru Flutter poate ajuta la dezvoltarea de componente UI de \xeenalt\u0103 calitate, care pot fi reutilizate \xeen \xeentreaga aplica\u021bie. Utilizarea unui storybook poate economisi timp \u0219i efort, deoarece dezvoltatorii pot vedea cum sunt implementate diferite componente UI \xeentr-un singur loc, iar apoi le pot utiliza \xeen mod corespunz\u0103tor \xeen \xeentreaga aplica\u021bie.\n\n\u2022 \xcen plus, un storybook poate fi utilizat pentru a \xeemp\u0103rt\u0103\u0219i exemple \u0219i idei cu ceilal\u021bi membri ai echipei de dezvoltare, ceea ce poate duce la \xeembun\u0103t\u0103\u021birea \u0219i uniformizarea design-ului \u0219i a func\u021bionalit\u0103\u021bii aplica\u021biei.\n\n\u2022 \xcen concluzie, crearea unui storybook pentru Flutter este o metod\u0103 util\u0103 pentru dezvoltarea de componente UI de \xeenalt\u0103 calitate, uniformizarea design-ului \u0219i oferirea de exemple clare. Aceast\u0103 metod\u0103 poate economisi timp \u0219i efort \u0219i poate duce la dezvoltarea unei aplica\u021bii cu un aspect \u0219i o func\u021bionalitate coerent\u0103 \u0219i consistent\u0103.\n",null)
B.E9=new A.ol("Start your journey",' \u2022 Ideea de a avea separat proiectul in folderul de widgetbook si nu in lib vine din ideea de a putea fi importat in orice proiect direct\n  si apoi doar folosit in cadrul folderului de lib ca atare.\n\n \u2022 Pentru a porni proiectul trebuie mai intai sa avem instalat flutter sdk -> https://flutter.dev/;\n\n \u0222 Adaugam flutter in path astfel, \n \n pentru Windows:\n    - WINDOWS_KEY+R_KEY;\n    - Scriem SystemPropertiesAdvanced;\n    - Click Environment Variables;\n    - In User variables selectam Path si dam edit;\n    - Adaugam calea catre bin (Ex: C:\\flutter\\bin);\n    - Ok si asta e tot;\n\npentru Linux/MacOS:\n    - echo $SHELL (asa ne vom da seama daca folosim bash sau z shell);\n    - in functie de raspuns daca e bash-> nano ~/.bash_profile si scriem export PATH="$PATH:/Users/[my_user_name]/Development/flutter/bin/";\n    - daca e zshell -> nano ~/.zshrc si scriem export PATH="$PATH:/Users/[my_user_name]/Development/flutter/bin/";\n    - in ambele cazuri la final salvam si rulam comanda source ~/.zshrc sau ~/.bash_profile in functie de situatie;\n\n \u2022 Trebuie sa rulam apoi comanda flutter pub get in terminal;\n',null)
